import React from "react";

export class List extends React.Component {
  render() {
    let ini = [];
    for (let i = 0; i < 10; i++) {
      ini.push(
        <li>
          <div className="one_list">
            <p
              style={{ backgroundColor: "red", width: 20, borderRadius: 2 }}
              className="list"
            >
              #{i + 1}
            </p>
            <p className="list">judul ke-{i + 1}</p>
            <p className="list">Publisher ke-{i + 1}</p>
          </div>
        </li>
      );
    }
    return <ul>{ini}</ul>;
  }
}
